import "./About.css";
import Home from "./Home";

const About = () => {
  return (
    <>
      <Home />
      <div className="about">
        <h1>About us</h1>
        <p>
          Hey there! Welcome to Rock Climbing Adventures! We're a bunch of
          climbing enthusiasts on a mission to share the thrill of outdoor rock
          climbing with you. Whether you're a seasoned pro or a total newbie,
          we've got you covered. Get ready to explore our interactive map of
          epic climbing locations worldwide. From breathtaking mountains to
          scenic canyons, we've handpicked the best spots just for you. Find
          detailed info, cool routes, and safety tips to plan your next epic
          adventure. Our blog is filled with expert tips, gear recommendations,
          and inspiring stories to keep you motivated and informed. Plus, join
          our friendly community of climbers where you can connect, share
          experiences, and find awesome climbing buddies. Have questions or want
          to contribute? Reach out to us anytime. Let's climb, connect, and make
          unforgettable memories together. Climb on! [Your Name] Founder, Rock
          Climbing Adventures
        </p>
      </div>
    </>
  );
};

export default About;
